import React, { Component } from 'react';

class Userlist extends Component {
    constructor(){
        super()
        this.state={
            list: null,
        }
    }

    componentDidMount(){
        fetch("http://localhost:3000/users").then((response)=>{
            response.json().then((result)=>{
                console.warn(result)
            })
        })
    }

    render() {
        return (
            <div>
                <h1>Users</h1>
            </div>
        );
    }
}

export default Userlist;
